//               "seloptions": "var TEMPLATE_PRESTART = \"82BFD30A8331103A0AB62BA4CD88C8\";\nvar TEMPLATE_DOCKET = \"76107A892B3508581323B526BE87F4\";\n\n/*\n   Version 1.0.2\n\n   1.0.1 (11/11/2019)\n   - Added function to load prestart when button is clicked if a prestart does not already exist\n\n   1.0.2 (24/06/2020)\n   - Added additional check for determining if a prestart template has been defined\n   - Added check for allocation to project\n*/\n\nvar tool = Query.selectId(\"Tools.tools\", recordId);\nvar projectid = tool.projectid;\n\nif(projectid == \"\")\n{\n   App.confirm(\"Please allocate this equipment to a project first\");\n}\nelse\n{\n   var prestartCreated = false;\n\n   if(TEMPLATE_PRESTART != \"\")\n   {\n      var prestartForms = Query.select(\"Forms.forms\", \"*\", \"templateid=\" + esc(TEMPLATE_PRESTART) + \" AND linkedid=\" + esc(form.id), \"date DESC\");\n      var prestartByDate = new Date(Date.now());\n      prestartByDate.setHours(prestartByDate.getHours() - 8);\n\n      if(prestartForms.length == 0 || prestartForms[0].date < prestartByDate.getTime())\n      {\n         var template = Query.selectId(\"Forms.templates\", TEMPLATE_PRESTART);\n\n         Forms.createForm(template.name, \"Tools.tools\", tool.id);\n         prestartCreated = true;\n      }\n      else \n      {\n         var dockets = Query.select(\"Forms.forms\", \"*\", \"templateid=\" + esc(TEMPLATE_DOCKET) + \" AND date>\" + prestartForms[0].date);\n\n         for(var i = 0; i < dockets.length; i += 1)\n         {\n            if(dockets[i].value == \"\")\n               continue;\n\n            var docketValues = JSON.parse(dockets[i].value);\n\n            if(docketValues.F44 == tool.id)\n            {\n               var template = Query.selectId(\"Forms.templates\", TEMPLATE_PRESTART);\n\n               Forms.createForm(template.name, \"Tools.tools\", tool.id);\n               prestartCreated = true;\n               break;\n            }\n         }\n      }\n   }\n   \n   if(!prestartCreated)\n   {\n      var templatename = 'Daily Docket (Sniffers)';\n      var linkedtable = 'Projects.projects';\n      var linkedid = projectid;\n      var equipment = form.id;\n      var defaultno = '0';\n\n      var contact = Query.select(\"Contacts.contacts\", \"*\", \"name=\" + esc(User.getName()), null);\n      \n      if(contact.length > 0)\n         var contact = contact[0].id;\n      else\n         var contact = \"\";\n\n      var values = {};\n      values.F7 = defaultno;\n      values.F15 = defaultno;\n      values.F22 = defaultno;\n      values.F29 = defaultno;\n      values.F63 = defaultno;\n      values.F44 = equipment; // HiddenEquipmentField\n      values.F1 = projectid; //Project/Site\n      values.F34 = contact;\n      Forms.createForm(templatename, linkedtable, linkedid, values);\n   }\n}",
